/**
 * Get display name for a given channel name
 * Converts channel identifiers to human-readable names
 */
export const getChannelDisplayName = (channelName: string): string => {
  const name = channelName.toLowerCase()
  const displayNames: Record<string, string> = {
    airbnb: 'Airbnb',
    vrbo: 'VRBO',
    booking_com: 'Booking.com',
    google: 'Google',
    direct: 'Direct',
    expedia: 'Expedia',
  }
  return displayNames[name] || channelName
}
